import React, { useState } from 'react';

const MealForm = ({ onSubmit }) => {
  const [purpose, setPurpose] = useState('');
  const [height, setHeight] = useState('');
  const [weight, setWeight] = useState('');
  const [gender, setGender] = useState('');
  const [dietPreference, setDietPreference] = useState({
    Vegetarian: false,
    Vegan: false,
    Keto: false,
    Paleo: false,
  });
  const [allergies, setAllergies] = useState('');
  const [mealsPerDay, setMealsPerDay] = useState('');
  const [snacksPerDay, setSnacksPerDay] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    const userData = {
      primaryPurpose: purpose,
      height: parseFloat(height),
      weight: parseFloat(weight),
      gender: gender,
      dietPreference: dietPreference,
      allergies: allergies,
      mealsPerDay: parseInt(mealsPerDay, 10),
      snacksPerDay: parseInt(snacksPerDay, 10),
    };

    onSubmit(userData);
  };

  const handleDietPreferenceChange = (preference) => {
    setDietPreference({
      ...dietPreference,
      [preference]: !dietPreference[preference],
    });
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>
          Purpose:
          <input
            type="text"
            value={purpose}
            onChange={(e) => setPurpose(e.target.value)}
          />
        </label>
      </div>
      <div>
        <label>
          Height (cm):
          <input
            type="number"
            value={height}
            onChange={(e) => setHeight(e.target.value)}
          />
        </label>
      </div>
      <div>
        <label>
          Weight (kg):
          <input
            type="number"
            value={weight}
            onChange={(e) => setWeight(e.target.value)}
          />
        </label>
      </div>
      <div>
        <label>
          Gender:
          <select value={gender} onChange={(e) => setGender(e.target.value)}>
            <option value="">Select Gender</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="other">Other</option>
          </select>
        </label>
      </div>
      <div>
        <label>
          Diet Preferences:
          {Object.keys(dietPreference).map((preference) => (
            <label key={preference}>
              <input
                type="checkbox"
                checked={dietPreference[preference]}
                onChange={() => handleDietPreferenceChange(preference)}
              />
              {preference}
            </label>
          ))}
        </label>
      </div>
      <div>
        <label>
          Allergies:
          <input
            type="text"
            value={allergies}
            onChange={(e) => setAllergies(e.target.value)}
          />
        </label>
      </div>
      <div>
        <label>
          Meals Per Day:
          <input
            type="number"
            value={mealsPerDay}
            onChange={(e) => setMealsPerDay(e.target.value)}
          />
        </label>
      </div>
      <div>
        <label>
          Snacks Per Day:
          <input
            type="number"
            value={snacksPerDay}
            onChange={(e) => setSnacksPerDay(e.target.value)}
          />
        </label>
      </div>
      <div>
        <button type="submit">Generate Meal Plan</button>
      </div>
    </form>
  );
};

export default MealForm;
